of Non-Polar Extraction Preparation:</b> 2g and 2g of each Test Item (Foam and Tubing Material) and 60cm2 of test item (Thin film) was weighed / taken and transferred to the sterile beaker containing 55 mL of sesame oil. </p><p data-v-1d6e38ae>Similar procedure was followed for polar and non-polar control without adding Test Item.</p><p data-v-1d6e38ae>All the (polar and non-polar test item and polar and non-polar control) were subjected to extraction at 37.0 °C with continuous agitation in orbital shaker incubator at 110 rpm.</p><p data-v-1d6e38ae>Pre and post extraction condition for the appearance of extracts was checked. The final extract was observed for the presence of visual particles. Extraction procedure was carried out under aseptic condition.</p><p data-v-1d6e38ae>Absorption ratio of the Form was determined and found to be in range of 14 mL for 0.9% NaCl and 25 mL for sesame oil.</p><p data-v-1d6e38ae>pH of polar and non-polar test item extracts and control was checked using pH strips and pH was measured between 6-7.</p><p data-v-1d6e38ae>The left over test item and test item extract after administration is stored in a container and send for disposal.</p></div></section><section id=\"sec31\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-1d6e38ae><div class=\"col-12\" data-v-1d6e38ae><p class=\"font-weight-bold\" data-v-1d6e38ae>17.3.1.2 Extraction Conditions</p><p data-v-1d6e38ae>Vehicle and extraction condition is as depicted below:</p><table class=\"table table-bordered\" data-v-1d6e38ae><thead data-v-1d6e38ae><tr data-v-1d6e38ae><th rowspan=\"2\" data-v-1d6e38ae>Date/phase</th><th rowspan=\"2\" data-v-1d6e38ae>Vehicle</th><th colspan=\"3\" data-v-1d6e38ae>Extraction Temperature (in ºC)</th><th rowspan=\"2\" data-v-1d6e38ae>Total Extraction Time</th><th rowspan=\"2\" data-v-1d6e38ae>Extract appearance</th></tr><tr data-v-1d6e38ae><th data-v-1d6e38ae>Set value</th><th data-v-1d6e38ae>Maximum</th><th data-v-1d6e38ae>Minimum</th></tr></thead><tbody data-v-1d6e