7.0</td><td rowspan=\"4\" data-v-1d6e38ae>XXX</td><td data-v-1d6e38ae>Clear</td></tr><tr data-v-1d6e38ae><td data-v-1d6e38ae>Polar test item extract</td><td data-v-1d6e38ae>37.0</td><td data-v-1d6e38ae>37.1</td><td data-v-1d6e38ae>37.0</td><td data-v-1d6e38ae>Clear</td></tr><tr data-v-1d6e38ae><td data-v-1d6e38ae>Non-polar vehicle</td><td data-v-1d6e38ae>37.0</td><td data-v-1d6e38ae>37.1</td><td data-v-1d6e38ae>37.0</td><td data-v-1d6e38ae>Clear</td></tr><tr data-v-1d6e38ae><td data-v-1d6e38ae>Non-Polar test item extract</td><td data-v-1d6e38ae>37.0</td><td data-v-1d6e38ae>37.1</td><td data-v-1d6e38ae>37.0</td><td data-v-1d6e38ae>Clear</td></tr></tbody></table></div></section><section id=\"sec32\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-1d6e38ae><div class=\"col-12\" data-v-1d6e38ae><p class=\"font-weight-bold\" data-v-1d6e38ae>17.3.1.3 Intradermal Induction Phase</p><p data-v-1d6e38ae>The animals of test groups (G2a and G2b) and control group (G1a and G1b) were injected with polar and non-polar test item extracts and polar and non-polar vehicle control respectively. The animals were injected at the shoulder region with 0.1 mL per injection of 3 pairs of intradermal injections. Injections 1 and 2 were given near the head region at least 1 cm apart and injections 3 were given 2 cm apart towards caudal part of the body.</p><p data-v-1d6e38ae><b data-v-1d6e38ae>Figure 1:</b> Site of intra-dermal injections in the Guinea pig for maximization test of Magnusson and Kligman (Annexure 3).</p><p data-v-1d6e38ae>Site A: 1st pair of injection<br data-v-1d6e38ae>Site B: 2nd pair of injection<br data-v-1d6e38ae>Site C: 3rd pair of injection</p><p class=\"font-weight-bold\" data-v-1d6e38ae>Polar Vehicle Control (G1a)</p><p data-v-1d6e38ae><li data-v-1d6e38ae>Site ‘A’ was injected intradermally with 0.1 mL of 1:1 mixture (v/v) of FCA in Physiological saline.</li><li data-v-1d6e38ae>Site ‘B’ was injected intradermally with 0.1 mL of Polar Vehicle control.</li><li data-v-1d6e38ae>Site ‘C’ was injected intradermally with 0.1 mL of 50% v/v polar Vehicle control in 1:1 mixture (v/v) of FCA in in Physiological saline.</li></p><p class=\"font-weight-bold\" data-v-1d6e38ae>Non-Polar Vehicle Control (G1b)</p><p data-v-1d6e38ae><li data-v-1d6e38ae>Site ‘A’ was injected intradermally with 0.1 mL of 1:1 mixture (v/v) of FCA in Physiological saline </li><li data-v-1d6e38ae>Site ‘B’ was injected intradermally with 0.1 mL of non-polar Vehicle control extract.</li><li data-v-1d6e38ae>Site ‘C’ was injected intradermally with 0.1 mL of 50% v/v non-polar Vehicle control extract in 1:1 mixture (v/v) of FCA in in Physiological saline.</li></p><p class=\"font-weight-bold\" data-v-1d6e38ae>Polar Test Item Extract (G2a)</p><p data-v-1d6e38ae><li data-v-1d6e38ae>Site ‘A’ was injected intradermally with 0.1 mL of 1:1 mixture (v/v) of FCA in Physiological saline</li><li data-v-1d6e38ae>Site ‘B’ was injected intradermally with 0.1 mL of undiluted polar test item extract.</li><li data-v-1d6e38ae>Site ‘C’ was injected intradermally with 0.1 mL of 50% v/v undiluted polar test item extract in 1:1 mixture (v/v) of FCA in in Physiological saline.</li></p><p class=\"font-weight-bold\" data-v-1d6e38ae>Non-Polar Test Item Extract (G2b)</p><p data-v-1d6e38ae><li data-v-1d6e38ae>Site ‘A’ was injected intradermally with 0.1 mL of 1:1 mixture (v/v) of FCA in Physiological saline</li><li data-v-1d6e38ae>Site ‘B’ was injected intradermally with 0.1 mL of undiluted non-polar test item extract.</li><li data-v-1d6e38ae>Site ‘C’ was injected intradermally with 0.1 mL of 50% v/v undiluted Non- polar test item extract in 1:1 mixture (v/v) of FCA in in Physiological saline.</li></p></div></section><section id=\"sec33\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-1d6e38ae><div class=\"col-12\" data-v-1d6e38ae><p class=\"font-weight-bold\" data-v-1d6e38ae>17.3.1.5 Challenge Phase</p><p data-v-1d6e38ae>After 14 days, completion of the topical induction phase (i.e., Day 21), fur was removed from left and right flank areas using electric clipper.</p><p data-v-1d6e38ae>On day 22, the filter paper (2 cm x 4 cm) was loaded with 0.5mL respective vehicle control and test item extract as below:</p><table class=\"table table-bordered\" data-v-1d6e38ae><tbody data-v-1d6e38ae><tr data-v-1d6e38ae><td rowspan=\"2\" data-v-1d6e38ae>G1a</td><td data-v-1d6e38ae>Anterior Right Flank</td><td data-v-1d6e38ae>Polar Vehicle Control</td></tr><tr data-v-1d6e38ae><td data-v-1d6e38ae>Anterior Left Flank</td><td data-v-1d6e38ae>Undiluted Polar Test Item Extract</td></tr><tr data-v-1d6e38ae><td rowspan=\"2\" data-v-1d6e38ae>G2a</td><td data-v-1d6e38ae>Anterior Right Flank</td><td data-v-1d6e38ae>Polar Vehicle Control</td></tr><tr data-v-1d6e38ae><td data-v-1d6e38ae>Anterior Left Flank</td><td data-v-1d6e38ae>Undiluted Polar Test Item Extract</td></tr><tr data-v-1d6e38ae><td rowspan=\"2\" data-v-1d6e38ae>G1b</td><td data-v-1d6e38ae>Anterior Right Flank</td><td data-v-1d6e38ae>Non-polar Vehicle Control </td></tr><tr data-v-1d6e38ae><td data-v-1d6e38ae>Anterior Left Flank</td><td data-v-1d6e38ae>Undiluted Non-Polar Test Item Extract</td></tr><tr data-v-1d6e38ae><td rowspan=\"2\" data-v-1d6e38ae>G2b</td><td data-v-1d6e38ae>Anterior Right Flank</td><td data-v-1d6e38ae>Non-polar Vehicle Control </td></tr><tr data-v-1d6e38ae><td data-v-1d6e38ae>Anterior Left Flank</td><td data-v-1d6e38ae>Undiluted Non-Polar Test Item Extract</td></tr></tbody></table><p data-v-1d6e38ae>The patches were secured with semi occlusive dressing. Patches were removed after 24 hrs.</p></div></section><section id=\"sec34\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-1d6e38ae><div class=\"col-12\" data-v-1d6e38ae><p class=\"font-weight-bold\" data-v-1d6e38ae>17.3.1.6 Re-challenge Phase</p><p data-v-1d6e38ae>Re-challenge phase was not done as there was no signs of any irritation were observed during challenge phase.</p></div></section><section id=\"sec35\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-1d6e38ae><div class=\"col-12\" data-v-1d6e38ae><p class=\"font-weight-bold\" data-v-1d6e38ae>18 OBSERVATIONS</p><p class=\"font-weight-bold\" data-v-1d6e38ae>18.1 Mortality, Morbidity and Clinical Signs</p><p data-v-1d6e38ae>Animals were observed twice daily for mortality, morbidity and once daily for clinical signs throughout the observation period. There were no clinical signs observed, hence the animals were observed once for morbidity and mortality during weekends and holidays.</p></div></section>", 7);
